    [],nt"revision_timestamp": "2016-07-27T22:42:17.147516",nt"name": "preliminary-assessment-investigation-final-summary-report-dead-zone-site-laysan-island-haw",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this report is to assess
    the risks that the "Laysan Dead Zone" poses to the health of U.S. Fish and Wildlife
    Service (Service) personnel and natural resources at the Laysan Island in the Hawaiian
    Islands National Wildlife Refuge and implement remedial actions, as appropriate.
    The Laysan Island Preliminary Assessment/Investigation is intended to determine
    the cause of the Dead Zone phenomenon as well as to identify any possible sources.
    The following activities are discussed: encompassed the following activities: records
    search, photodocumentation, radiation screen, geophysical survey (electromagnetic),
    biota investigation, shallow soil boring collection (to a maximum depth of 5 feet),
    surface soil sample collection (point and composite), soil sample analysis, soil
    sample archiving, and site clearance.",nt"license_title": "License Not Specified",nt"extras":
